import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';
import View from './pages/View';

function App() {
  return (
   <BrowserRouter>
    <div>
      <Route path="/" element={Home} />
      <Route />
    </div>
   </BrowserRouter>
  );
}

export default App;
